package com.example.mvcproducts.bootstrap;

import com.example.mvcproducts.domain.*;
import com.example.mvcproducts.services.*;
import org.springframework.boot.CommandLineRunner;
import org.springframework.stereotype.Component;

@Component
public class DataLoader implements CommandLineRunner {
  private final ProductService productService;
  private final LoginService loginService;
  private final UserService userService;
  private final HistoryService historyService;
  private final WalletService walletService;

  public DataLoader(ProductService productService, LoginService loginService, UserService userService, HistoryService historyService, WalletService walletService) {
    this.productService = productService;
    this.loginService = loginService;
    this.userService = userService;
    this.historyService = historyService;
    this.walletService = walletService;
  }

  @Override
  public void run(String... args) throws Exception {

    User user1 = new User();
    User user2 = new User();
    user1.setFirstname("Radu");
    user2.setLastname("D");
    user2.setFirstname("Mihai");
    user2.setLastname("M");
    userService.save(user1);
    userService.save(user2);

    Wallet wallet1 = new Wallet();
    wallet1.setEur(100);
    wallet1.setUser(user1);
    Wallet wallet2 = new Wallet();
    wallet2.setEur(200);
    wallet2.setUser(user2);
    walletService.save(wallet1);
    walletService.save(wallet2);

    Product product1 = new Product();
    product1.setUser(user1);
    product1.setPrice(50);
    product1.setCurrency("eur");
    product1.setVisible(true);
    product1.setName("dog");
    product1.setCollection("animals");
    product1.setPicture("");

    Product product2 = new Product();
    product2.setUser(user2);
    product2.setPrice(60);
    product2.setCurrency("bitcoin");
    product2.setVisible(true);
    product2.setName("cat");
    product2.setCollection("animals");
    product2.setPicture("");


    Product product3 = new Product();
    product3.setUser(user2);
    product3.setPrice(70);
    product3.setCurrency("ron");
    product3.setVisible(true);
    product3.setName("raccoon");
    product3.setCollection("animals");
    product3.setPicture("");

    productService.save(product1);
    productService.save(product2);
    productService.save(product3);

  }
}
